module.exports = /*#__PURE__*/JSON.parse('{"archive":{"blogPosts":[{"id":"2024-1q-summary","metadata":{"permalink":"/whatap-docs/blog/2024-1q-summary","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-1q-summary.mdx","source":"@site/blog/2024-1q-summary.mdx","title":"와탭 24년 1분기 안내","description":"와탭의 2024년 1분기 서비스 신규 기능 및 주목할 만한 변경 사항 개요를 안내합니다. 와탭이 새롭게 제공하는 기능들을 한 눈에 살펴보세요.","date":"2024-05-20T15:30:00.000Z","tags":[{"inline":true,"label":"새로운 기능","permalink":"/whatap-docs/blog/tags/새로운-기능"},{"inline":true,"label":"24년","permalink":"/whatap-docs/blog/tags/24-년"},{"inline":true,"label":"1분기","permalink":"/whatap-docs/blog/tags/1-분기"},{"inline":true,"label":"분기 안내","permalink":"/whatap-docs/blog/tags/분기-안내"},{"inline":true,"label":"서비스","permalink":"/whatap-docs/blog/tags/서비스"},{"inline":true,"label":"에이전트","permalink":"/whatap-docs/blog/tags/에이전트"}],"readingTime":27.045,"hasTruncateMarker":true,"authors":[{"name":"TW J","email":"ysjo@whatap.io","title":"테크니컬 라이터","imageURL":"./img/teamtwj.svg","key":"ysj"}],"frontMatter":{"slug":"2024-1q-summary","title":"와탭 24년 1분기 안내","authors":"ysj","date":"2024-05-20T15:30","toc_max_heading_level":2,"tags":["새로운 기능","24년","1분기","분기 안내","서비스","에이전트"]},"unlisted":false,"nextItem":{"title":"와탭 23년 4분기 안내","permalink":"/whatap-docs/blog/2023-4q-summary"}},"content":"와탭의 2024년 1분기 서비스 신규 기능 및 주목할 만한 변경 사항 개요를 안내합니다. 와탭이 새롭게 제공하는 기능들을 한 눈에 살펴보세요.\\n\\n![새로운 기능 sc](/img/changelog/changelog-new3.png)\\n\\n{/* truncate */}\\n\\n{/* 먼저 1분기 상품별 신규 기능 및 신규 상품 요약은 다음과 같습니다. 사이드 메뉴 개편 및 대시보드 고도화 작업이 이루어졌습니다.  */}\\n\\n{/* 요약은 다시 써야 함 */}\\n\\n<div class =\'faq\'>\\n\\n|**공통**|\\n|---| \\n\\n> * **사이드 메뉴**가 개편되었습니다.  \\n> * 메트릭스 필드 중심의 사용자 경험을 강화한 ***이벤트 설정*** <code class=\\"newfunc\\">New</code> 기능을 새롭게 제공합니다. \\n> * **SSO 계정 연동** 기능이 추가되었습니다.\\n\\n|**Application**|\\n|---|\\n\\n> * ***통계*** 및 ***인스턴스 성능 관리*** 메뉴 구조를 개선했습니다. \\n> * ***트랜잭션 맵***이 고도화되었습니다. \\n> * `Go` 상품 베타 서비스를 종료하고 **정식** 서비스를 제공합니다.\\n\\n|**Server**|\\n|---|\\n\\n> Unix **AIX** 에이전트 설치 패키지를 제공합니다. \\n\\n|**Kubernetes**|\\n|---|\\n\\n> * **컨트롤 플레인 모니터링**을 새롭게 제공합니다. 컨트롤 플레인 컴포넌트 중 kube-apiserver 모니터링을 위해 ***kube-apiserver 대시보드*** 및 ***kube-apiserver 메트릭스 조회*** 기능이 추가되었습니다. \\n> * 기존의 Pod 초기화 성능 기능 및 마스터 메타 정보 기능을 개편해 ***Pod 시작 분석***과 ***오브젝트 매니페스트*** 기능을 제공합니다. \\n> * Deployment 기준으로 관련 정보를 조회할 수 있는 ***Deployment 목록***, 마스터 및 노드 에이전트 설치 현황을 확인할 수 있는 ***쿠버네티스 에이전트 목록*** 기능이 추가되었습니다. \\n> * 마스터 및 노드 에이전트 설치 시 *Helm* 차트 설치를 지원합니다. \\n\\n|**Database**|\\n|---|\\n\\n> * `MongoDB`와 `Redis` 상품에서 차트 및 수집 기능을 강화한 새로운 <code class=\\"my\\">V2</code> 서비스를 제공합니다.\\n> * 기존에 XOS와 XOS2로 나누어져 있던 지표를 **XOS**로 통합해 백분율 표기로 확인할 수 있도록 변경했습니다. \\n\\n|**Browser**|\\n|---|\\n\\n> ***사용자 세션 분석*** 기능을 새롭게 제공합니다. \\n\\n|**Network**|\\n|---|\\n\\n> **네트워크 성능 모니터링**(Network Performance Monitoring) 상품이 **정식**으로 출시되었습니다. \\n\\n</div>\\n\\n상품별 신규 기능 외 변경 사항 개요 및 해당 릴리스 버전, 에이전트 변경 사항은 다음 안내를 통해 확인할 수 있습니다.\\n\\n<br/>\\n<br/>\\n\\n## `공통`\\n\\n와탭 2024년 1분기 `공통` 부분의 주목할 만한 신규 기능으로 사이드 메뉴 개편, SSO 계정 연동 기능 추가 및 새로운 이벤트 설정 기능을 소개합니다. \\n\\n사용자 편의성 향상을 위해 5년 만에 와탭 모니터링의 **사이드 메뉴**가 새롭게 개편되었습니다. 와탭 서비스 이용에는 프로젝트 선택이 선행됩니다. 프로젝트 생성 및 선택 이후 동선을 편리하게 활용할 수 있도록 기존과 비교해 UI 혼잡도를 줄여 프로젝트 선택과 메뉴의 영역을 확보하는 구조로 개편되었습니다. \\n\\n프로젝트 목록을 선택한 부분만 펼쳐서 확인할 수 있으며, 세로 영역을 확보해 보다 편하게 다양한 기능 메뉴를 조회할 수 있습니다. 또한 간단한 별 모양(<LinkImage img=\'ic-star.svg\' desc=\'비교하기 아이콘\'/>) 아이콘 클릭으로 상품별 프로젝트 메뉴 내 자주 쓰는 기능들을 즐겨찾기 할 수 있습니다. \\n\\n<ImgLang img=\'release/release-main-ui.png\' desc=\'사이드 메뉴 개편 cl\' />\\n\\n또한 **SSO 계정 연동 기능**이 추가되었습니다. 클라우드 기반 사용자 계정 관리 및 접근 권한 관리 솔루션 **Okta**와 와탭 모니터링을 연동할 수 있습니다. 조직 내에서 사용 중인 **Okta** 계정을 이용해 와탭 서비스에 로그인 후 서비스를 이용할 수 있습니다. \\n\\n<ImgLang img=\'sso-check-sso-info.png\' desc=\'sso-info cl\' />\\n\\n새로운 ***이벤트 설정*** <code class=\\"newfunc\\">New</code> 기능은 필드(Field) 중심의 사용자 경험을 강화하여 카테고리보다 필드를 먼저 선택하는 방식으로 사용자가 인지하는 지표와 이벤트 설정의 불일치를 해소했습니다. 또한 상품에 적합한 기본 이벤트 템플릿을 제공해 보다 쉽게 경고 알림 이벤트를 설정할 수 있습니다. \\n\\n![이벤트 v2 cl](/img/changelog/changelog-common-event-v2.png)\\n\\n다음 개요 안내를 통해 2024년 1분기 공통 부분의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Common_1q from \\"../crw-data/crwld-service/_import-service-Common.mdx\\";\\n\\n<Common_1q />\\n\\n</details>\\n\\n:::note \\n\\n* 사이드 메뉴 개편에 대한 자세한 내용은 [다음 문서](https://www.whatap.io/bbs/board.php?bo_table=blog&wr_id=214)를 참조하세요. \\n\\n* SSO 계정 연동 기능에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/account/sso)를 참조하세요. \\n\\n* 새로운 ***이벤트 설정*** <code class=\\"newfunc\\">New</code>에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/java/warning-notice-v2)를 참조하세요. \\n\\n:::\\n\\n<br/>\\n\\n\\n## `Application`\\n\\n와탭 2024년 1분기 `Application` 상품군의 주목할 만한 신규 기능 및 변경 사항으로 `Go` 상품의 정식 출시, ***트랜잭션 맵***의 고도화, 그리고 ***통계*** 및 ***인스턴스 성능 관리*** 메뉴 구조의 개선을 소개합니다.  \\n\\n`Go` 애플리케이션 모니터링이 베타 버전 종료 후 **정식** 서비스를 시작했습니다. 와탭의 `Go` 애플리케이션 모니터링은 웹 프레임워크를 지원하고, Go Runtime 패키지의 정보를 지속적으로 수집합니다. 또한 MSA 환경에서 연계 추적을 통해 호출 관계를 수집합니다. \\n\\n***트랜잭션 맵***은 성능 테스트 또는 장애 상황 발생 시 단기간 트랜잭션별 현황을 상세히 확인할 수 있는 메뉴입니다. 다음과 같이 ***트랜잭션 맵*** 고도화 작업이 이루어졌습니다. \\n\\n기존 TX 트레이스 섹션을 제거한 대신 차트 드래그 시 ***트레이스 분석*** 팝업 창을 통해 상세 정보를 확인할 수 있도록 구조를 개선했습니다. 또한 트레이스 분석 건수를 기존 100건에서 **1000**건으로 확장해 이전보다 10배 많은 트레이스를 분석할 수 있게 되었습니다. \\n\\n그외에도 한 화면에서 필터를 적용해 동작을 최소화하는 방향으로 **필터** 기능을 개선하였습니다. 예를 들어 트랜잭션 필터를 이용해 선택한 트랜잭션만 선별해 조회할 수 있습니다. 그리고 기존 실시간 최대 5분 뿐만 아니라 과거 시점 최대 10분까지 데이터를 조회할 수 있도록 변경해 전반적으로 편의성을 향상시켰습니다.  \\n\\n {/* 그외에도 ***Top 30*** 섹션에 IP 필터 기능을 추가했고, ***멀티 트랜잭션*** 탭에서 프로잭트 선택 상태를 저장하는 등 트랜잭션 분석 시 편의성을 전반적으로 향상시켰습니다.  */}\\n\\n<ImgLang img=\'changelog/changelog-app-tx-map.png\' desc=\'sc\' className=\'changelog-img\'/>\\n\\n***통계***와 ***인스턴스 성능 관리*** 메뉴의 경우 각 메뉴의 탭 메뉴 구성을 개별 하위 메뉴로 구성하는 등 동선과 안정성 향상을 위한 개선 작업이 이루어졌습니다.\\n\\n![통계 및 인스턴스 성능 모니터링 sc cl](/img/changelog/changelog-app-stat-instance.png)\\n\\n{/* 안정적으로 각 기능을 사용할 수 있도록 / 기존 문제 개선 및 다양한 안정화 작업을 진행했습니다. */}\\n\\n다음 개요 안내를 통해 2024년 1분기 `Application` 상품군의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n{/* <code class=\\"New\\">New</code> `Go` 모니터링 상품 **정식 서비스** 시작 <code class=\'changelog-service\'>Service 2.2.4​</code> */}\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Application_1q from \\"../crw-data/crwld-service/_import-service-Application.mdx\\";\\n\\n<Application_1q />\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\n### `Java`\\n\\nimport Java_agent_1q from \\"../crw-data/crwld-agent/_import-agent-java.mdx\\";\\n\\n<Java_agent_1q />\\n\\n### `PHP`\\n\\nimport PHP_agent_1q from \\"../crw-data/crwld-agent/_import-agent-php.mdx\\";\\n\\n<PHP_agent_1q />\\n\\n### `Python`\\n\\nimport Python_agent_1q from \\"../crw-data/crwld-agent/_import-agent-python.mdx\\";\\n\\n<Python_agent_1q />\\n\\n### `Node.js`\\n\\nimport Node_agent_1q from \\"../crw-data/crwld-agent/_import-agent-nodejs.mdx\\";\\n\\n<Node_agent_1q />\\n\\n### `Go`\\n\\nimport Go_agent_1q from \\"../crw-data/crwld-agent/_import-agent-golang.mdx\\";\\n\\n<Go_agent_1q />\\n\\n</details>\\n\\n<br/>\\n\\n## `Server`\\n\\n와탭 2024년 1분기 `Server` 상품의 주목할 만한 신규 기능 및 변경 사항으로 **Unix** `AIX` 설치 패키지에 대해 소개합니다. \\n\\n이번 1분기에 새롭게 **Unix** `AIX` **에이전트 설치 패키지**를 제공합니다. IBM이 개발한 AIX는 엔터프라이즈 서버에서 주로 사용됩니다. 확장성, 호환성, 엔터프라이즈 환경에서의 견고함을 위해 특별히 설계된 운영체제입니다. \\n\\n와탭은 **AIX 버전 6.1** 이상을 지원합니다. `AIX` 설치 패키지를 통해 해당 패키지를 다운로드 받은 후 실행하는 것만으로 간단하게 설치할 수 있습니다. 와탭 서버 모니터링을 통해 AIX 운영체제를 보다 효과적으로 관리하고 모니터링할 수 있습니다. \\n\\n![AIX sc cl](/img/changelog/changelog-server-aix.png)\\n\\n다음 개요 안내를 통해 2024년 1분기 `Server` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Server_1q from \\"../crw-data/crwld-service/_import-service-Server.mdx\\";\\n\\n<Server_1q />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\nimport Server_agent_1q from \\"../crw-data/crwld-agent/_import-agent-server.mdx\\";\\n\\n<Server_agent_1q />\\n\\n</details>\\n\\n:::note \\n\\nAIX 설치에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/server/server-os/server-aix)를 참조하세요. \\n\\n:::\\n\\n<br/>\\n\\n## `Kubernetes`\\n\\n와탭 2024년 1분기 `Kubernetes` 상품의 주목할 만한 신규 기능 및 변경 사항으로 새로운 기능인 **컨트롤 플레인 모니터링**, ***쿠버네티스 에이전트 목록***, ***Deployment 목록***, 그리고 개편된 기능인 ***Pod 시작 분석***과 ***오브젝트 매니페스트***, 아울러 새로 추가된 **Helm** 차트 설치 지원 등에 대해서 소개합니다. \\n\\n와탭 쿠버네티스 모니터링은 이번 1분기에 새롭게 **컨트롤 플레인 모니터링**을 제공합니다. 쿠버네티스 클러스터 전반을 관리하는 컨트롤 플레인 컴포넌트 중 클러스터 내 API 요청을 처리하는 kube-apiserver에 대한 가시성 확보를 위해 ***kube-apiserver 대시보드*** 및 ***kube-apiserver 메트릭스 조회*** 기능이 추가되었습니다. \\n\\n***kube-apiserver 대시보드***는 kube-apiserver의 상태 및 성능 메트릭 수집, 응답 시간, 처리량, 요청 실패 등을 추적하여 클러스터의 가용성과 성능을 모니터링할 수 있습니다. ***kube-apiserver 메트릭스 조회***를 통해서는 kube-apiserver 수집 지표 목록을 조회할 수 있습니다.\\n\\n![컨트롤 플레인 모니터링 sc cl](/img/changelog/changelog-k8s-kube-apiserver.png)\\n\\n또한 Deployment 기준으로 관련 정보를 조회할 수 있는 ***Deployment 목록***, 마스터 및 노드 에이전트 설치 현황을 확인할 수 있는 ***쿠버네티스 에이전트 목록*** 기능이 추가되었습니다. \\n\\n개별 Pod 보다 Pod 집합 상태를 모니터링하는 것이 서비스 안정성과 성능 확보를 위해 중요합니다. 애플리케이션 배포 및 업데이트를 담당하는 Deployment 모니터링은 그러한 의미에서 필수적입니다. ***Deployment 목록***에서 리소스 관계도 및 클러스터 내 Pod, 컨테이너, 애플리케이션 현황 및 CPU, 메모리, 트랜잭션 수 등 주요 성능 지표를 Deployment 단위로 조회할 수 있습니다. \\n\\n또한 새롭게 추가된 ***쿠버네티스 에이전트 목록***에서는 마스터 및 노드 에이전트 설치 현황을 한 눈에 살펴볼 수 있습니다.\\n\\n그리고 기존의 Pod 초기화 성능 기능 및 마스터 메타 정보 기능을 개편해 각 ***Pod 시작 분석***과 ***오브젝트 매니페스트*** 기능을 제공합니다. ***Pod 시작 분석***은 Pod별 시작 시점 정밀 분석을 통해 기동에 소요되는 시간과 리소스 사용량에 대한 상세 데이터를 제공합니다. ***오브젝트 매니페스트***는 오브젝트별 과거 조회 및 비교 기능이 추가되어 클러스터 내 변동 사항을 쉽게 추적할 수 있습니다. \\n\\n![오브젝트 매니페스트 및 Pod 시작 분석 sc cl](/img/changelog/changelog-k8s-om-podinit.png)\\n\\n{/* \\n\\n뿐만 아니라 Deployment 기준으로 리소스 관계도 및 트레이스, 로그, 메트릭스와 같은 옵저버빌리티의 핵심 데이터를 한 눈에 확인할 수 있습니다. \\n\\n클러스터 관리 효율성 향상 */}\\n\\n아울러 마스터 및 노드 에이전트 설치 시 기존 Yaml 파일 방식 외 운영 복잡도를 덜어줄 **Helm** 차트 설치 방식을 공식적으로 지원합니다. \\n\\n다음 개요 안내를 통해 2024년 1분기 `Kubernetes` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Kubernetes_1q from \\"../crw-data/crwld-service/_import-service-Kubernetes.mdx\\";\\n\\n<Kubernetes_1q />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\nimport Kubernetes_agent_1q from \\"../crw-data/crwld-agent/_import-agent-k8s.mdx\\";\\n\\n<Kubernetes_agent_1q />\\n\\n</details>\\n\\n:::note \\n\\n* ***kube-apiserver 대시보드***에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/kubernetes/kube-apiserver-dashboard)를 참조하세요. \\n\\n* ***kube-apiserver 메트릭스 조회***에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/kubernetes/kube-apiserver-metrics-search)를 참조하세요. \\n\\n* ***Deployment 목록***에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/kubernetes/deployment-list)를 참조하세요. \\n\\n* ***쿠버네티스 에이전트 목록***에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/kubernetes/agent-list)를 참조하세요. \\n\\n* 마스터 및 노드 에이전트 *Helm* 차트 설치 방식에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/kubernetes/install-master-node-agent#create-kubernetes-agent)를 참조하세요. \\n\\n:::\\n\\n<br/>\\n\\n## `Database`\\n\\n와탭 2024년 1분기 `Database` 상품군의 주목할 만한 신규 기능 및 변경 사항으로 **Redis**와 **MongoDB** 상품 <code class=\\"my\\">V2</code> 출시에 대해 소개합니다.\\n\\n와탭 `Database` 상품군이  <code class=\\"my\\">V2</code>로 전환되고 있습니다. 기존 **PostgreSQL**과 **MySQL**에 뒤이어 이번 1분기에는 **Redis**와 **MongoDB** <code class=\\"my\\">V2</code> 서비스가 시작되었습니다. <code class=\\"my\\">V2</code>는 전반적으로 차트 및 수집 기능이 강화되었습니다.  \\n\\n![데이터베이스 sc cl](/img/changelog/changelog-db.png)\\n\\n***대시보드*** 메뉴의 UI 및 기능을 개선하였으며, 해당 메뉴에서 데이터베이스의 성능 지표 정보를 바로 확인할 수 있습니다. 또한 ***멀티 인스턴스 모니터링*** 메뉴에서 클러스터별 에이전트를 선택할 수 있습니다. 그리고 데이터베이스 로그를 검색하고 추이를 확인하고 로그 관련 알림을 받을 수 있는 ***로그*** 메뉴를 제공합니다.\\n\\n<code class=\\"my\\">V2</code> 전환과 동시에 기존 XOS와 XOS2로 나누어져 있던 지표를 %로 확인할 수 있는 백분률 표기로 변경하고 **XOS**로 통합해 제공합니다.\\n\\n다음 개요 안내를 통해 2024년 1분기 `Database` 상품군의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Database_1q from \\"../crw-data/crwld-service/_import-service-Database.mdx\\";\\n\\n<Database_1q />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\nimport DBX_agent_1q from \\"../crw-data/crwld-agent/_import-agent-dbx.mdx\\";\\n\\n<DBX_agent_1q />\\n\\n</details>\\n\\n<br/>\\n\\n## `Browser`\\n\\n와탭 2024년 1분기 `Browser` 상품의 주목할 만한 신규 기능 및 변경 사항으로 ***사용자 세션 분석*** 기능 및 ***사용자 정의 이벤트 수집 기능***을 소개합니다. \\n\\n이번 1분기에 새롭게 제공하는 ***사용자 세션 분석*** 기능은 사용자의 웹 페이지 탐색 방식을 파악하고자 할 때 활용할 수 있습니다. 사용자가 어떻게 움직이고, 어떤 페이지에 머무르고 있는지, 화면의 어떤 요소를 클릭하는지, 화면에서 발생하는 에러 등에 관한 사용자의 전반적인 활동을 분석해 사용자가 서비스를 이용하는 방식에 대한 통찰을 얻는 것뿐 아니라 사용자의 행동 패턴을 이해하는 데에 더 가까워질 수 있습니다. \\n\\n***사용자 세션 로그 검색***, ***AJAX 히트맵***과 ***페이지 로드 히트맵***을 이용해 사용자의 페이지 내 행동 분석 및 세션 중 발생하는 여러 에러 추적이 가능합니다. 세션 로그 정보를 통해 최종 사용자의 경로, 이탈 원인, 성능 및 사용자 경험 등을 분석할 수 있습니다. 또한 ***AJAX 히트맵***과 ***페이지 로드 히트맵***에서 실시간으로 문제를 겪고 있는 사용자를 파악할 수 있습니다. 이러한 정보를 통해 사용자의 서비스 경험과 서비스의 현재 성능 상태를 확인할 수 있습니다.\\n\\n<ImgLang img=\'browser-search-user-session-log-analysis.png\' desc=\'사용자 세션 분석\' className=\'changelog-img\'/>\\n\\n***사용자 정의 이벤트 수집*** 기능은 브라우저 모니터링이 제공하는 기본 정보 외 사용자가 원하는 이벤트를 추가적으로 수집할 수 있는 인터페이스를 제공합니다. 브라우저 에이전트에서 제공하는 인터페이스 중 `addCustomEvent` 메소드를 이용해 사용자 정의형 이벤트를 수집 후 ***사용자 세션 로그 검색*** 메뉴 또는 ***Flex 보드***를 통해 수집한 데이터를 조회할 수 있습니다. \\n\\n{/* 사용자가 웹 페이지를 탐색하는 방식을 이해할 수 있도록 돕습니다. 파악을 돕습니다.   */}\\n\\n다음 개요 안내를 통해 2024년 1분기 `Browser` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Browser_1q from \\"../crw-data/crwld-service/_import-service-Browser.mdx\\";\\n\\n<Browser_1q />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\nimport Browser_agent_1q from \\"../crw-data/crwld-agent/_import-agent-browser.mdx\\";\\n\\n<Browser_agent_1q />\\n\\n</details>\\n\\n<br/>\\n\\n## `Network`\\n\\n와탭 2024년 1분기에 네트워크 간의 혼잡 및 장애를 파악하고 사용자의 네트워크 성능 개선을 위해 프로세스의 네트워크 정보를 수집하는 **네트워크 성능 모니터링**(**Network Performance Monitoring**) 상품이 정식으로 출시되었습니다. \\n\\n![네트워크 모니터링 sc cl](/img/changelog/changelog-network.png)\\n\\n최근 네트워크 시장은 클라우드와 가상화라는 큰 틀에서 성장하고 있습니다. 기존 장비 중심의 네트워크 모니터링 뿐만 아니라 작업을 수행하는 프로세스가 중요한 모니터링 대상이 되고 있습니다. 와탭 네트워크 성능 모니터링을 통해 프로세스 단위의 네트워크 지표를 안정적으로 모니터링해 보세요.\\n\\n와탭의 `Network` 상품은 각 프로세스가 수행하는 네트워크 동작을 추적해 복잡한 구성 요소와 상태 정보를 토폴로지를 통해 직관적으로 이해할 수 있도록 시각화했습니다. **품질 지표** ***Latency***와 ***Jitter***, 그리고 **네트워크 사용량 지표** ***bps***, ***pps***, ***session count***를 조회할 수 있습니다. 또한 태그 옵션으로 가시성을 확보하였으며, ***Flex 보드***를 통해 다양한 사용자 커스텀 차트를 제공합니다.\\n\\n다음 개요 안내를 통해 2024년 1분기 `Network` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Network_1q from \\"../crw-data/crwld-service/_import-service-Network.mdx\\";\\n\\n<Network_1q />\\n\\n</details>\\n\\n:::note \\n\\n* `Network` 상품에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/npm/introduction)를 참조하세요. \\n\\n* AWS 리소스 식별 관련한 에이전트 옵션 안내에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/npm/set-aws-resource-options)를 확인하세요. \\n\\n:::\\n\\n<br/>\\n\\n{/* ## `AWSLog`\\n\\n<div class=\'indentTab\'>\\n\\nimport AWSLog_1q from \\"../crw-data/crwld-service/_import-service-AWSLog.mdx\\";\\n\\n<AWSLog_1q />\\n\\n</div> <br/> */}\\n\\n## `Log`\\n\\n와탭 2024년 1분기 `Log` 상품의 주목할 만한 신규 기능 및 변경 사항으로 개편된 **로그 검색 필터 기능**을 소개합니다. \\n\\n***로그 검색*** 및 ***라이브 테일*** 메뉴 내 **로그 검색 필터 기능**이 개편되었습니다. 검색 값 입력 시 안내 가이드 UI를 통해 지원하는 검색 문법을 확인할 수 있고, 키보드 입력으로 태그를 생성 및 수정하고 연산자를 클릭해 수정할 수 있는 기능이 추가되었습니다.\\n\\n또한 에이전트 옵션이 설정된 경우 로그 레벨(<span class=\'logwr\'>WARN</span>, <span class=\'loger\'>ERROR</span>, <span class=\'logft\'>FATAL</span>)을 수집해 로그 목록 왼쪽에서 해당 기준 색상을 표시하는 기능이 추가되었습니다.  \\n\\n![로그 에이전트 옵션 cl](/img/log-agent-option-level.png)\\n\\n다음 개요 안내를 통해 2024년 1분기 `Log` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Log_1q from \\"../crw-data/crwld-service/_import-service-Log.mdx\\";\\n\\n<Log_1q />\\n\\n</details>\\n\\n<br/>"},{"id":"2023-4q-summary","metadata":{"permalink":"/whatap-docs/blog/2023-4q-summary","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-4q-summary.mdx","source":"@site/blog/2023-4q-summary.mdx","title":"와탭 23년 4분기 안내","description":"와탭의 2023년 4분기 서비스 신규 기능 및 주목할 만한 변경 사항 개요를 안내합니다. 와탭이 새롭게 제공하는 기능들을 한 눈에 살펴보세요.","date":"2024-05-20T15:20:00.000Z","tags":[{"inline":true,"label":"새로운 기능","permalink":"/whatap-docs/blog/tags/새로운-기능"},{"inline":true,"label":"23년","permalink":"/whatap-docs/blog/tags/23-년"},{"inline":true,"label":"4분기","permalink":"/whatap-docs/blog/tags/4-분기"},{"inline":true,"label":"분기 안내","permalink":"/whatap-docs/blog/tags/분기-안내"},{"inline":true,"label":"서비스","permalink":"/whatap-docs/blog/tags/서비스"},{"inline":true,"label":"에이전트","permalink":"/whatap-docs/blog/tags/에이전트"}],"readingTime":18.915,"hasTruncateMarker":true,"authors":[{"name":"TW J","email":"ysjo@whatap.io","title":"테크니컬 라이터","imageURL":"./img/teamtwj.svg","key":"ysj"}],"frontMatter":{"slug":"2023-4q-summary","title":"와탭 23년 4분기 안내","authors":"ysj","date":"2024-05-20T15:20","toc_max_heading_level":2,"tags":["새로운 기능","23년","4분기","분기 안내","서비스","에이전트"]},"unlisted":false,"prevItem":{"title":"와탭 24년 1분기 안내","permalink":"/whatap-docs/blog/2024-1q-summary"},"nextItem":{"title":"와탭 23년 3분기 안내","permalink":"/whatap-docs/blog/2023-3q-summary"}},"content":"와탭의 2023년 4분기 서비스 신규 기능 및 주목할 만한 변경 사항 개요를 안내합니다. 와탭이 새롭게 제공하는 기능들을 한 눈에 살펴보세요.\\n\\n![새로운 기능 sc](/img/changelog/changelog-new3.png)\\n\\n{/* truncate */}\\n\\n<div class =\'faq\'>\\n\\n|**공통**|\\n|---| \\n\\n> * **와탭 모바일 앱**을 새롭게 출시했습니다.\\n> * 편의성 향상을 위해 ***상품 카탈로그*** 및 일부 메뉴의 화면을 개선했습니다. \\n> * ***정비 계획*** 메뉴 <code class=\\"my\\">V2</code>를 제공합니다.\\n\\n{/* > * ***결제 정보*** 및 ***에이전트 설정*** 메뉴 등의 화면이 개선되었습니다. */}\\n\\n|**Application**|\\n|---|\\n\\n> * ***트레이스 분석*** 기능이 개편되었습니다. \\n> * ***대시보드***가 프리셋 방식으로 개편되었습니다. \\n\\n|**Server**|\\n|---|\\n\\n> ***이벤트 수신 태그*** 옵션을 제공합니다.\\n\\n|**Kubernetes**|\\n|---|\\n\\n> * ***컨테이너 맵*** 메뉴 화면을 개선했습니다.\\n> * ***리소스*** 하위 목록 메뉴가 추가되었습니다. \\n\\n{/* > * 통합 컨테이너 맵\\n> * 메뉴 간 동선 개편 */}\\n\\n|**Database**|\\n|---|\\n\\n> `PostgreSQL`과 `MySQL` 상품 <code class=\\"my\\">V2</code> 정식 전환 및 해당 <code class=\\"my\\">V2</code> 서비스 개선이 이루어졌습니다. \\n\\n|**Browser**|\\n|---|\\n\\n> ***AJAX 히트맵*** 메뉴를 제공합니다.\\n\\n{/* |**Network**|\\n|---|\\n\\n> **네트워크 성능 모니터링**(Network Performance Monitoring) 상품 **베타** 서비스가 출시되었습니다.  */}\\n\\n</div>\\n\\n상품별 신규 기능 외 변경 사항 개요 및 해당 릴리스 버전, 에이전트 변경 사항은 다음 안내를 통해 확인할 수 있습니다.\\n\\n\\n<br/>\\n<br/>\\n\\n## `공통`\\n\\n와탭 2023년 4분기 `공통` 부분의 주목할만한 신규 기능 및 변경 사항으로 와탭 **모바일 앱**의 출시, 화면 개선 사항 및 정비 계획 <code class=\\"my\\">V2</code> 제공에 대해 소개합니다.\\n\\n이번 4분기에 와탭 **모바일 앱**이 새롭게 출시되었습니다. 앱을 통해 와탭 모니터링 서비스 ***대시보드*** 주요 차트를 확인하거나 실시간으로 알림을 받을 수 있습니다. 또한 OTP 기능을 활용해 로그인 시 2차 인증 도구로 활용할 수 있습니다. 향후 업데이트를 통해 지원 범위를 확대할 예정입니다.\\n\\n![모바일 앱 sc cl](/img/changelog/changelog-mobile-app.png)\\n\\n더 나은 사용자 경험과 편의성 향상을 위해 서비스 화면을 개선했습니다. 와탭 모니터링 서비스의 정기 배포 소식 및 긴급 점검 등을 확인할 수 있는 **서비스 공지 사항** 기능이 추가되었고, 상품 카탈로그 화면이 개편되었으며, 사이드바 메뉴에서 상품 소개 정보를 확인할 수 있습니다. \\n\\n그외 ***결제 정보*** 및 ***에이전트 설정*** 등 일부 메뉴 화면 역시 개선했습니다. ***결제 정보*** 메뉴의 경우 결제 정보 입력 시 통화 선택을 제공합니다. ***에이전트 설정*** 메뉴의 경우 옵션 목록을 간소화해 가독성을 높였으며, 옵션 작성 시 적용된 최종 옵션 항목만 보이도록 변경되었습니다.\\n\\n기존 ***정비 계획***을 개편한 신규 ***정비 계획*** <code class=\\"my\\">V2</code>를 제공합니다. 신규 ***정비 계획***을 통해 에이전트별로 정비 계획을 추가할 수 있고, 서버 프로젝트에서도 반복 옵션을 사용할 수 있습니다. 다만 기존 정비 계획과 신규 정비 계획은 호환되지 않습니다. \\n\\n![정비 계획 sc cl](/img/changelog/changelog-maintenance-plan.png)\\n\\n다음 개요 안내를 통해 2023년 4분기 공통 부분의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Common_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-Common.mdx\\";\\n\\n<Common_23q4 />\\n\\n</details>\\n\\n:::note \\n\\n* 모바일 앱에 대한 자세한 내용은 [다음 문서](../../mobile-app)를 참조하세요. 링크를 선택하거나 QR 코드를 스캔해 모바일 앱을 다운로드하세요.\\n\\n  | [iOS](https://apps.apple.com/us/app/whatap-mobile/id6450067434) | [Android](https://play.google.com/store/apps/details?id=io.whatap.lion) |\\n  | :--: | :--: |\\n  | ![QR](/img/mobile/whatap-app-ios.png) | ![QR](/img/mobile/whatap-app-android.png) |\\n\\n* 신규 ***정비 계획***에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/management/maintenance#maintenance-v2)를 참조하세요. \\n\\n:::\\n\\n<br/>\\n\\n## `Applicatoin`\\n\\n와탭 2023년 4분기 `Application` 상품군의 주목할 만한 신규 기능 및 변경 사항으로 ***히트맵*** 및 ***대시보드*** 고도화에 대해 소개합니다. \\n\\n***히트맵*** 고도화 작업의 일환으로 ***히트맵*** 드래그 시 ***트레이스 분석*** 창이 개편되었습니다. ***멀티 트랜잭션*** 탭에 프로젝트 필터 기능이 추가되었고 또한 이제 ***트랜잭션 로그*** 탭에서 로그 데이터 미조회 시 상황에 알맞게 안내 메시지를 출력합니다. 예를 들어 로그 데이터가 없는 경우, 에이전트 미설정으로 수집을 하지 못 한 경우, 로그 비활성화 상태인 경우를 각각 확인할 수 있습니다. \\n\\n***애플리케이션 대시보드***를 개편했습니다. 시간 선택자 옵션이 추가되어 실시간 뿐 아니라 **과거 데이터**를 조회할 수 있습니다. 그리고 대시보드 내 사용자가 원하는대로 위젯을 추가 및 삭제할 수 있고 크기 역시 조절할 수 있습니다. 편집한 위젯의 위치, 크기, 레이아웃을 저장해 불러올 수 있는 **프리셋** 기능이 추가되었습니다. \\n\\n| 과거 데이터 조회 |\\n| :--: |\\n| ![](/img/release/none-realtime-mode.png) |\\n| **대시보드 프리셋** |\\n| ![](/img/release/apm-dashboard-preset-feature.png) |\\n\\n또한 일부 애플리케이션 중복 지표 명칭에 대한 통일화 및 표준화 작업이 이루어졌습니다. 예를 들어 URL, 트랜잭션, 트랜잭션 명으로 사용되던 지표명을 ***트랜잭션***으로 통일했습니다. 또한 기존 HTTPC, HTTP 호출, HTTPC 건수 등으로 사용되던 지표명을 ***HTTP 호출 건수***로 통일했습니다. 그외에도 다수 전반적인 용어 표준화가 이루어졌습니다. \\n\\n다음 개요 안내를 통해 2023년 4분기 `Application` 상품군의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Applicatoin_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-Application.mdx\\";\\n\\n<Applicatoin_23q4 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\n### `Java`\\n\\nimport Java_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-java.mdx\\";\\n\\n<Java_agent_23q4 />\\n\\n{/* ### `PHP`\\n\\nimport PHP_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-php.mdx\\";\\n\\n<PHP_agent_23q4 />\\n\\n### `Python`\\n\\nimport Python_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-python.mdx\\";\\n\\n<Python_agent_23q4 /> */}\\n\\n### `Node.js`\\n\\nimport Node_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-nodejs.mdx\\";\\n\\n<Node_agent_23q4 />\\n\\n### `.NET`\\n\\nimport DOTNET_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-dotnet.mdx\\";\\n\\n<DOTNET_agent_23q4 />\\n\\n{/* ### `Go`\\n\\nimport Go_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-golang.mdx\\";\\n\\n<Go_agent_23q4 /> */}\\n\\n</details>\\n\\n<br/>\\n\\n## `Server`\\n\\n와탭 2023년 4분기 `Server` 상품의 주목할 만한 신규 기능 및 변경 사항으로 ***서버 상세*** 및 ***이벤트 설정*** 메뉴 개선 사항을 소개합니다.\\n\\n***서버 상세*** 메뉴에서 차트 내 x축 표시 단위를 시간 기준으로 변경해 일자 기준 뷰의 가독성을 높였습니다.\\n\\n***이벤트 설정*** 메뉴 내 서버 및 프로세스 이벤트에 프로젝트 특정 멤버 또는 팀 대상으로 알림 수신 여부를 설정할 수 있는 ***이벤트 수신 태그*** 옵션이 추가되었습니다. 또한 기본 알림명을 수정할 수 있게 되었으며, 기본 알림의 경우 이제 `기본` 태그를 별도로 표시합니다.\\n\\n다음 개요 안내를 통해 2023년 4분기 `Server` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Server_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-Server.mdx\\";\\n\\n<Server_23q4 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\nimport Server_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-server.mdx\\";\\n\\n<Server_agent_23q4 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Kubernetes`\\n\\n와탭 2023년 4분기 `Kubernetes` 상품의 주목할 만한 신규 기능 및 변경 사항으로 ***컨테이너 맵*** 개선 및 추가된 ***리소스*** 하위 목록 메뉴에 대해 소개합니다. \\n\\n{/* 와탭 쿠버네티스 모니터링 상품의 경우 통합 컨테이너 맵 개발 및 메뉴 간 동선 개편 */}\\n\\n와탭 쿠버네티스 모니터링의 ***컨테이너 맵***은 지속적으로 고도화 작업이 이루어지고 있습니다. 이번 4분기에는 상세 보기 창에서 컨테이너 상 실행 중인 애플리케이션의 호출 흐름과 외부 호출 상태를 확인할 수 있는 ***호출 정보*** 탭이 새로 추가되었습니다. \\n\\n<ImgLang img=\'k8s-container-map-call-info-app.png\' desc=\'App 호출 흐름도\' />\\n\\n또한 컨테이너와 Pod 뷰 모두 블록 색상 표시 지표에 애플리케이션 관련 필드 목록(`app_counter`)을 선택할 수 있습니다. 그리고 1분간 사라진 컨테이너 및 Pod의 블록을 표시하는 기능이 추가되었습니다. \\n\\n뿐만 아니라 ***리소스*** 하위의 목록 메뉴가 개편 및 새로 추가되었습니다. ***노드 목록*** 메뉴는 노드 정보 지표, 필터 검색 기능이 추가되었습니다. 또한 시간 갱신 간격이 1분에서 10초로 변경되었습니다. 클러스터와 관련된 버전 정보 및 각종 오브젝트 정보를 한 눈에 확인할 수 있는 ***클러스터 요약*** 메뉴가 새로 추가되었습니다. \\n\\n새롭게 네임스페이스 프로젝트의 ***실험실***에 ***Pending Pods*** 메뉴가 추가되었습니다. ***Pending Pods*** 메뉴는 Pending 상태에 놓인 Pod를 빠르게 파악하기 위한 실험 기능입니다. \\n\\n다음 개요 안내를 통해 2023년 4분기 `Kubernetes` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Kubernetes_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-Kubernetes.mdx\\";\\n\\n<Kubernetes_23q4 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\n#### <code class=\'changelog-service\'>Kubernetes Agent v1.3.8</code> <code class=\'changelog-date\'>2023년 10월 04일</code>\\n\\n- <Status>Feature</Status> 파드(Pod) 목록 신규 개발을 위한 데이터 추가 수집(podIp, age, restartCount)\\n\\n#### <code class=\'changelog-service\'>Kubernetes Agent v1.4.1</code> <code class=\'changelog-date\'>2023년 11월 08일</code>\\n\\n- <Status>Feature</Status> 쿠버네티스의 클러스터 정보 추가\\n\\n#### <code class=\'changelog-service\'>Kubernetes Agent v1.4.2</code> <code class=\'changelog-date\'>2023년 11월 16일</code>\\n\\n- <Status>Feature</Status> <code>kube_pod</code> 카테고리에 수집 데이터 추가\\n\\n  - <code>qosClass</code>: Pod에 대한 서비스 품질\\n  - <code>startTime</code>: Pod 시작 시간\\n  - <code>podHash</code>: Pod 이름의 해시값\\n  - <code>con_cpu_limit_total</code>: Pod 내부 컨테이너의 cpu limit 합계\\n  - <code>con_mem_alloc_fail_total_count</code>: Pod 내부 컨테이너의 memory 할당 실패 수 합계\\n\\n</details>\\n\\n<br/>\\n\\n\\n## `Database`\\n\\n와탭 2023년 4분기 `Database` 상품군의 주목할 만한 신규 기능 및 변경 사항을 다음과 같이 소개합니다. \\n\\n이번 4분기에 `Database` 상품군 중 **PostgreSQL**와 **MySQL** 상품 <code class=\\"my\\">V2</code> 서비스가 정식 서비스로 전환되었습니다. 그리고 기존 **MS SQL Server** 상품의 이름을 **SQL Server**로 변경했습니다.\\n{/* 먼저 **PostgreSQL**에 뒤이어 이번 4분기에 `Database` 상품군 중 **MySQL** 상품 <code class=\\"my\\">V2</code> 서비스가 정식 서비스로 전환되었습니다. 그리고 기존 **MS SQL Server** 상품의 이름을 **SQL Server**로 변경했습니다.  */}\\n\\n`Database` 상품군 공통으로 사용자 편의성 향상을 위해 ***SQL 상세*** 메뉴 화면의 UI가 개선되었습니다. 쿼리 조회 영역과 Plan 조회 영역 배치를 사용자가 수정할 수 있고, 파라미터 바인드를 기본 수행하도록 변경되었습니다. 또한 ***인스턴스 모니터링*** 및 ***멀티 인스턴스 모니터링*** 메뉴에서 액티브 세션 테이블을 접어 그래프 차트를 더 넓게 확인할 수 있습니다.\\n\\n다음 개요 안내를 통해 2023년 4분기 `Database` 상품군의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Database_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-Database.mdx\\";\\n\\n<Database_23q4 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\n#### DBX\\n\\nimport DBX_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-dbx.mdx\\";\\n\\n<DBX_agent_23q4 />\\n\\n#### XOS\\n\\nimport XOS_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-xos.mdx\\";\\n\\n<XOS_agent_23q4 />\\n\\n</details>\\n\\n<br/>\\n\\n## `URL`\\n\\n와탭 2023년 4분기 `URL` 상품의 경우 모니터링 데이터를 수집하는 간격을 선택할 수 있는 UI가 새로 추가되었습니다. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport URL_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-URL.mdx\\";\\n\\n<URL_23q4 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Browser`\\n\\n와탭 2023년 4분기 `Browser` 상품의 주목할 만한 신규 기능으로 ***AJAX 히트맵***을 소개합니다.\\n\\nAsynchronous JavaScript and XML(**AJAX**)는 비동기 방식으로 데이터를 교환해 웹 페이지를 업데이트하는 기술입니다. 사용자 경험을 개선하고 서버로의 요청을 줄이는 장점을 가진 AJAX는 JavaScript 코드로 구현되기에 모니터링이 필요합니다. \\n\\n와탭 `Browser` 모니터링이 제공하는 ***AJAX 히트맵*** 메뉴를 통해 시간에 따른 AJAX 이벤트의 응답 시간을 히트맵 차트로 확인할 수 있으며 각 이벤트 구간별 세부 시간 정보, AJAX 요청 URL 및 호출 페이지 정보, 에러 메시지 및 상태 코드 등의 상세 정보를 조회할 수 있습니다. \\n\\n![AJAX 히트맵 sc cl](/img/changelog/changelog-browser-ajax.png)\\n\\n다음 개요 안내를 통해 2023년 4분기 `Browser` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Browser_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-Browser.mdx\\";\\n\\n<Browser_23q4 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\nimport Browser_agent_23q4 from \\"../crw-data/crwld-agent-23/_import-agent-23q4-browser.mdx\\";\\n\\n<Browser_agent_23q4 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Cloud`\\n\\n와탭 2023년 4분기 `Cloud` 상품의 경우 프로젝트 내에서 사용자가 수행하는 상호 작용을 감지해 사용자 행동에 대한 통찰을 제공하는 ***사용자 행위*** 메뉴가 새로 추가되었습니다. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Cloud_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-Cloud.mdx\\";\\n\\n<Cloud_23q4 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Log`\\n\\n와탭 2023년 4분기 `Log` 상품의 주목할 만한 신규 기능 및 변경 사항을 다음과 같이 소개합니다.\\n\\n***로그 검색*** 메뉴에서 로그 검색 필터 문법을 안내하는 **가이드 UI**가 추가되었습니다. 가이드 UI를 통해 검색 값 입력 시 지원하는 검색 문법을 확인할 수 있습니다.\\n\\n<ImgLang img=\'log-filter-ui1.png\' desc=\'로그 필터 cl\'/>\\n\\n그리고 타임스탬프와 로그만을 확인할 수 있도록 전체 화면 전환 기능이 추가되었으며, 로그 1차 파서 설정 탭에서 파서 추가 시 로그 검출 조건의 검색 값 입력 후 예약어에 대한 유효성 검증이 추가되었습니다. \\n\\n다음 개요 안내를 통해 2023년 4분기 `Log` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Log_23q4 from \\"../crw-data/crwld-service-23q4/_import-23q4-service-Log.mdx\\";\\n\\n<Log_23q4 />\\n\\n</details>\\n\\n<br/>"},{"id":"2023-3q-summary","metadata":{"permalink":"/whatap-docs/blog/2023-3q-summary","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2023-3q-summary.mdx","source":"@site/blog/2023-3q-summary.mdx","title":"와탭 23년 3분기 안내","description":"와탭의 2023년 3분기 서비스 신규 기능 및 주목할 만한 변경 사항 개요를 안내합니다. 와탭이 새롭게 제공하는 기능들을 한 눈에 살펴보세요.","date":"2024-05-20T15:10:00.000Z","tags":[{"inline":true,"label":"새로운 기능","permalink":"/whatap-docs/blog/tags/새로운-기능"},{"inline":true,"label":"23년","permalink":"/whatap-docs/blog/tags/23-년"},{"inline":true,"label":"3분기","permalink":"/whatap-docs/blog/tags/3-분기"},{"inline":true,"label":"분기 안내","permalink":"/whatap-docs/blog/tags/분기-안내"},{"inline":true,"label":"서비스","permalink":"/whatap-docs/blog/tags/서비스"},{"inline":true,"label":"에이전트","permalink":"/whatap-docs/blog/tags/에이전트"}],"readingTime":16.07,"hasTruncateMarker":true,"authors":[{"name":"TW J","email":"ysjo@whatap.io","title":"테크니컬 라이터","imageURL":"./img/teamtwj.svg","key":"ysj"}],"frontMatter":{"slug":"2023-3q-summary","title":"와탭 23년 3분기 안내","authors":"ysj","date":"2024-05-20T15:10","toc_max_heading_level":2,"tags":["새로운 기능","23년","3분기","분기 안내","서비스","에이전트"]},"unlisted":false,"prevItem":{"title":"와탭 23년 4분기 안내","permalink":"/whatap-docs/blog/2023-4q-summary"},"nextItem":{"title":"새로운 기능","permalink":"/whatap-docs/blog/index"}},"content":"와탭의 2023년 3분기 서비스 신규 기능 및 주목할 만한 변경 사항 개요를 안내합니다. 와탭이 새롭게 제공하는 기능들을 한 눈에 살펴보세요.\\n\\n![새로운 기능 sc](/img/changelog/changelog-new3.png)\\n\\n{/* truncate */}\\n\\n{/* db 상품 중 mysql v2 서비스 제공 시점 확인 필요 */}\\n\\n<div class =\'faq\'>\\n\\n|**공통**|\\n|---| \\n\\n> **프로젝트 플렉스 보드 편집** 권한이 추가되었습니다.\\n\\n|**Application**|\\n|---|\\n\\n> * ***트레이스 분석*** 기능이 새롭게 개편되었습니다.\\n> * ***트랜잭션 맵*** 메뉴 맵 차트가 개선되었습니다. \\n\\n|**Server**|\\n|---|\\n\\n> ***리소스 보드*** 및 ***이벤트 설정*** 메뉴가 개선되었습니다.\\n\\n|**Kubernetes**|\\n|---|\\n\\n> * ***Docker PHP*** 설치를 제공합니다.\\n> * ***통합 컨테이너 맵*** 메뉴를 제공합니다.\\n{/* > * ***컨테이너 맵*** 및 ***퍼포먼스 요약*** 메뉴가 개선되었습니다. */}\\n\\n|**Database**|\\n|---|\\n\\n> * **PostgreSQL** 상품 <code class=\\"my\\">V2</code> 서비스가 시작되었습니다.\\n> * **MySQL** 상품 <code class=\\"my\\">V2</code> 서비스가 시작되었습니다.\\n\\n|**Browser**|\\n|---|\\n\\n> * ***페이지로드 히트맵*** 메뉴가 개선되었습니다. \\n> * ***브라우저 에러*** 메뉴에서 에러 상세가 추가되었습니다. \\n\\n|**AWS Log**|\\n|---|\\n\\n> `AWS Log` 모니터링 상품 **정식** 서비스가 출시되었습니다. \\n\\n|**Network**|\\n|---|\\n\\n> **네트워크 성능 모니터링**(Network Performance Monitoring) 상품 베타 서비스가 시작되었습니다. \\n\\n</div>\\n\\n상품별 신규 기능 외 변경 사항 개요 및 해당 릴리스 버전, 에이전트 변경 사항은 다음 안내를 통해 확인할 수 있습니다.\\n\\n<br/>\\n<br/>\\n\\n## `공통`\\n\\n와탭 2023년 3분기 `공통` 부분의 주목할만한 신규 기능 및 변경 사항으로 **프로젝트 플렉스보드 편집** 권한 추가 및 편의성 향상을 위한 개선을 소개합니다.\\n\\n**프로젝트 플렉스보드 편집** 권한이 추가되어 이제 프로젝트 내 ***Flex 보드***를 수정하기 위해서는 해당 권한이 필요합니다. \\n\\n그외 전반적인 편의성 향상을 위한 업데이트가 이루어졌습니다. 와탭의 서비스 버전과 상품 목록을 확인할 수 있는 ***와탭 모니터링 정보*** 메뉴가 추가되었습니다. \\n\\n<LinkImage img=\'changelog/changelog-whatap-info.png\' desc=\'\' className=\'noneborder\' />\\n\\n또한  ***이벤트 수신 설정*** 시 **WhatsApp** 알림 설정이 새롭게 추가되었고 ***통합 보고서*** 메뉴에서 일간 보고서 생성 시 시간 선택 제한 방식이 변경되었습니다. 기존에는 종료 시간을 전일 23시 59분까지 선택할 수 있었지만, 이제 종료 시간을 현재 시간 기준 1시간 이전까지 선택할 수 있습니다. \\n\\n다음 개요 안내를 통해 2023년 3분기 공통 부분의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Common_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Common.mdx\\";\\n\\n<Common_23q3 />\\n\\n</details>\\n<br/>\\n\\n## `Applicatoin`\\n\\n와탭 2023년 3분기 `Application` 상품군의 주목할 만한 신규 기능 및 변경 사항으로 ***트랜잭션 분석*** 기능 개편 및 ***트랜잭션 맵*** 화면 개선에 대해 소개합니다. \\n\\n***트랜잭션 분석*** 기능 개편이 시작되었습니다. 기존에는 ***히트맵*** 아래로 트랜잭션 목록을 불러오는 방식이었지만, 이제 ***히트맵*** 드래그 시 ***트랜잭션 분석*** 팝업창이 나타나 구간별로 해당 상세 정보를 분석하고 비교하기 수월해졌습니다. 또한 트랜잭션 목록 필터에서 에러 건만 바로 확인할 수 있는 옵션이 추가되었습니다.\\n\\n<LinkImage img=\'release/release-note-tx-new-feature.png\' desc=\'\' className=\'noneborder\' />\\n\\n***트랜잭션 맵***은 가시성을 높이기 위해 맵 디자인을 변경하였으며, 일반 트랜잭션과 에러 트랜잭션이 겹치는 경우 에러 건이 먼저 보이도록 변경되었습니다.\\n\\n  | 수정 전 | 수정 후 |\\n  | :--: | :--: |\\n  | ![before](/img/release/before-transaction-chart.png) | ![after](/img/release/after-transaction-chart.png) |\\n\\n또한 `.NET` 상품의 경우 기존에 `Java`와 `Python` 상품에서만 제공되었던 ***스택*** 메뉴가 추가되었습니다. ***스택*** 메뉴를 통해 ***탑 스택***과 ***유니크 스택***, ***액티브 스택***을 간단하게 확인할 수 있습니다.\\n\\n다음 개요 안내를 통해 2023년 3분기 `Application` 상품군의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Application_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Application.mdx\\";\\n\\n<Application_23q3 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\n### `Java`\\n\\nimport Java_agent_23q3 from \\"../crw-data/crwld-agent-23/_import-agent-23q3-java.mdx\\";\\n\\n<Java_agent_23q3 />\\n\\n### `PHP`\\n\\n#### <code class=\'changelog-service\'>PHP Agent v2.6.2</code> <code class=\'changelog-date\'>2023년 9월 13일</code>\\n\\n* <Status>Feature</Status> 대용량 프로파일 처리 옵션 추가\\n\\n  - **whatap.large_profile_enabled** <span class=\'type\'>Boolean</span>\\n\\n    기본값 `false`\\n\\n    약 만 건 이하의 프로파일(스탭) 정보를 수집할 수 있습니다. 더 많은 양을 수집할 경우 `split_profile_enabled` 옵션으로 사용하는 것을 권장합니다.\\n\\n  - **whatap.split_profile_enabled** <span class=\'type\'>Boolean</span>\\n\\n    기본값 `false`\\n\\n    일정량의 프로파일을 가상 트랜잭션으로 분리하여 더 많은 프로파일 정보를 수집합니다. 여러 개의 트랜잭션 목록으로 분할 표기합니다.\\n\\n* <Status>Feature</Status> 프로파일 데이터 압축 전송 옵션 추가\\n\\n  * **whatap.profile_zip_enabled** <span class=\'type\'>Boolean</span>  기본값 `true`\\n\\n### `.NET`\\n\\n#### <code class=\'changelog-service\'>.NET Agent v2.1.1</code> <code class=\'changelog-date\'>2023년 7월 17일</code>\\n\\n* <Status>New</Status> Active Stack 지원\\n\\n* <Status>New</Status> 닷넷 지원환경 분석 도구 기능 추가\\n\\n#### <code class=\'changelog-service\'>.NET Agent v2.1.2</code> <code class=\'changelog-date\'>2023년 7월 20일</code>\\n\\n* <Status>New</Status> WCF 지원\\n\\n#### <code class=\'changelog-service\'>.NET Agent v2.1.5</code> <code class=\'changelog-date\'>2023년 9월 13일</code>\\n\\n- <Status>New</Status> 타임아웃 시간 조절하는 <code>webservice_method_timeout</code> 옵션 추가\\n\\n### `Go`\\n\\nimport Go_agent_23q3 from \\"../crw-data/crwld-agent-23/_import-agent-23q3-golang.mdx\\";\\n\\n<Go_agent_23q3 />\\n\\n</details>\\n\\n<br/>\\n\\n{/* ## `Application`, `Container`, `Server`\\n\\nimport Application-Container-Server_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Application-Container-Server.mdx\\";\\n\\n<Application-Container-Server_23q3 /> */}\\n\\n## `Server`\\n\\n와탭 2023년 3분기 `Server` 상품의 경우 ***이벤트 설정*** 메뉴에서 기존 이벤트 설정을 현재 프로젝트에 복사할 수 있는 기능이 추가되었고, 그외 ***리소스 보드*** 메뉴 내 에이전트 상태 위젯에 위험과 경고 상태가 구분되어 표시도록 하는 등 사용자 편의성 향상을 위한 개선 작업이 이루어졌습니다. \\n\\n다음 개요 안내를 통해 2023년 3분기 `Server` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Server_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Server.mdx\\";\\n\\n<Server_23q3 />\\n\\n</details>\\n\\n<br/>\\n\\n\\n## `Kubernetes`\\n\\n와탭 2023년 3분기 `Kubernetes` 상품의 주목할 만한 신규 기능 및 변경 사항으로 **Docker PHP** 설치 제공 및 새롭게 추가된 ***통합 컨테이너 맵*** 메뉴를 소개합니다.\\n\\n{/* ***컨테이너 맵*** 및 ***퍼포먼스 요약*** 메뉴의 개선에 대해 소개합니다. */}\\n\\n이제 Docker 컨테이너 기반으로 실행하는 **PHP 애플리케이션**에 와탭 모니터링 에이전트를 적용하고 컨테이너 이미지를 패키징할 수 있습니다. whatap-php 패키지를 설치 후 설치 스크립트 및 컨테이너 환경변수를 설정해 해당 에이전트를 설치할 수 있습니다. \\n\\n클러스터 프로젝트와 네임스페이스 프로젝트를 포함한 ***통합 컨테이너 맵*** 메뉴를 새롭게 제공합니다. 통합 컨테이너 맵은 프로젝트별 그룹화 옵션을 추가로 제공해 클러스터 프로젝트 및 네임스페이스 개별 프로젝트 내 컨테이너 맵을 조회할 수 있습니다.\\n\\n<LinkImage img=\'k8s-container-map-unified-whatapproject.png\' desc=\'\' className=\'noneborder\' />\\n\\n다음 개요 안내를 통해 2023년 3분기 `Kubernetes` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Container_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Container.mdx\\";\\n\\n<Container_23q3 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\n#### <code class=\'changelog-service\'>Kubernetes Agent v1.3.6</code> <code class=\'changelog-date\'>2023년 9월 25일</code>\\n\\n- <Status>Feature</Status> 노드 목록 개편을 위한 노드 정보(클러스터 버전, 노드 상태 등) 추가\\n\\n#### <code class=\'changelog-service\'>Kubernetes Agent v1.3.7</code> <code class=\'changelog-date\'>2023년 9월 27일</code>\\n\\n- <Status>Feature</Status> 개편될 애플리케이션 목록 메뉴에서 노드 목록 연동을 위한 key 값 추가\\n\\n</details>\\n\\n<br/>\\n\\n\\n## `Database`\\n\\n와탭 2023년 3분기 `Database` 상품군의 주목할 만한 신규 기능 및 변경 사항으로 <code class=\\"my\\">V2</code> 서비스 시작에 대해서 소개합니다.\\n\\n이번 3분기에 `PostgreSQL` 상품과 `MySQL` 상품의 <code class=\\"my\\">V2</code> 서비스가 시작되었습니다. <code class=\\"my\\">V2</code> 서비스는 편의성 향상에 중점을 두었습니다. \\n\\n제품 환경별로 RDS와 XOS 탭을 분리하였고 또한 ***인스턴스 모니터링*** 메뉴를 개선했습니다. 예를 들어 액티브 세션 테이블 프리셋 저장 옵션 및 세션 상세 정보 내 Plan 조회 옵션 등이 추가되었습니다. \\n\\n다음 개요 안내를 통해 2023년 3분기 `Database` 상품군의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Database_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Database.mdx\\";\\n\\n<Database_23q3 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\n#### DBX\\n\\nimport DBX_agent_23q3 from \\"../crw-data/crwld-agent-23/_import-agent-23q3-dbx.mdx\\";\\n\\n<DBX_agent_23q3 />\\n\\n#### XOS\\n\\nimport XOS_agent_23q3 from \\"../crw-data/crwld-agent-23/_import-agent-23q3-xos.mdx\\";\\n\\n<XOS_agent_23q3 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Browser`\\n\\n와탭 2023년 3분기 `Browser` 상품의 주목할 만한 신규 기능 및 변경 사항으로 ***페이지로드 히트맵*** 메뉴 개선 및 ***브라우저 에러*** 에러 상세 추가에 대해 소개합니다.\\n\\n***페이지로드 히트맵*** 메뉴의 경우 상세 페이지로드 데이터에 운영체제 버전 및 클라이언트 IP 정보가 추가되었고 필터 기능을 새롭게 제공합니다.\\n\\n이제 ***브라우저 에러*** 메뉴의 ***에러 메시지 테이블*** 목록에서 에러 메시지를 선택 시 에러 메시지를 기준으로 에러와 관련한 자세한 통계 정보를 확인할 수 있습니다. 뿐만 아니라 시간대별로 발생한 에러 로그 역시 살펴볼 수 있습니다.\\n\\n<LinkImage img=\'browser-error-details-log.png\' desc=\'Error log\' />\\n\\n다음 개요 안내를 통해 2023년 3분기 `Browser` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요. \\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Browser_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Browser.mdx\\";\\n\\n<Browser_23q3 />\\n\\n</details>\\n\\n<details className=\'changelog2\'>\\n<summary><b>에이전트 안내</b></summary>\\n\\nimport Browser_agent_23q3 from \\"../crw-data/crwld-agent-23/_import-agent-23q3-browser.mdx\\";\\n\\n<Browser_agent_23q3 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Network`\\n\\n와탭 2023년 3분기에 네트워크 간의 혼잡 및 장애를 파악하고 사용자의 네트워크 성능 개선을 위해 프로세스의 네트워크 정보를 수집하는 **네트워크 성능 모니터링**(**Network Performance Monitoring**) 상품 베타 서비스가 출시되었습니다. 상품에 대한 자세한 내용은 [다음 문서](https://docs.whatap.io/npm/introduction)를 참조하세요. \\n\\n<br/>\\n\\n{/* <details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Network_1q from \\"../crw-data/crwld-service/_import-service-Network.mdx\\";\\n\\n<Network_1q />\\n\\n</div>  */}\\n\\n{/* ## `CloudWatch`, `AZURE`, `OCI`, `NCP`\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Cloud_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-CloudWatch-AZURE-OCI-NCP.mdx\\";\\n\\n<Cloud_23q3 />\\n\\n</div><br/> */}\\n\\n## `AWS Log`\\n\\n와탭 2023년 3분기 `AWS Log` 모니터링 서비스가 정식으로 출시되었습니다. S3와 Log Group 각각 리소스별로 확인하는 번거로운 과정을 거칠 필요없이 와탭 `AWS Log`는 AWS 상에서 발생하는 각종 로그를 수집해 통합 모니터링을 제공합니다. 상품에 대한 자세한 내용은 <a href=\\"../../aws-log/introduction\\">다음 문서</a>를 참조하세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport AWSLog_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-AWSLog.mdx\\";\\n\\n<AWSLog_23q3 />\\n\\n</details>\\n\\n<br/>\\n\\n## `Log`\\n\\n와탭 2023년 3분기 `Log` 상품의 주목할 만한 신규 기능 및 변경 사항을 다음과 같이 소개합니다. \\n\\n전반적으로 편의성 향상을 위한 업데이트가 이루어졌습니다. ***로그 검색***, ***로그 트렌드***, ***트랜잭션 로그*** 메뉴에서 키워드 하이라이팅 기능이 추가되었습니다. 또한 ***로그 검색*** 메뉴에서 인접 로그 조회 기능이 추가되었습니다. \\n\\n다음 개요 안내를 통해 2023년 3분기 `Log` 상품의 신규 기능 및 주요 변경 사항을 해당 릴리스 버전과 함께 확인해 보세요.\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Log_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Log.mdx\\";\\n\\n<Log_23q3 />\\n\\n</details>\\n\\n<br/>\\n\\n{/* ## `실험실`\\n\\n<details className=\'changelog\'>\\n<summary><b>신규 기능 및 주요 변경 사항 안내</b></summary>\\n\\nimport Lab_23q3 from \\"../crw-data/crwld-service-23q3/_import-23q3-service-Lab.mdx\\";\\n\\n<Lab_23q3 />\\n\\n</div><br/> */}"},{"id":"index","metadata":{"permalink":"/whatap-docs/blog/index","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2024-index.mdx","source":"@site/blog/2024-index.mdx","title":"새로운 기능","description":"{/ changelog 관련 이미지 /}","date":"2024-04-08T10:00:00.000Z","tags":[{"inline":true,"label":"새로운 기능","permalink":"/whatap-docs/blog/tags/새로운-기능"},{"inline":true,"label":"콘텐츠 구성","permalink":"/whatap-docs/blog/tags/콘텐츠-구성"}],"readingTime":1.935,"hasTruncateMarker":true,"authors":[{"name":"TW 팀","email":"docs@whatp.io","title":"테크니컬 라이터 팀","imageURL":"./img/teamtw.svg","key":"twt"}],"frontMatter":{"slug":"index","title":"새로운 기능","authors":["twt"],"date":"2024-04-08T10:00","tags":["새로운 기능","콘텐츠 구성"]},"unlisted":false,"prevItem":{"title":"와탭 23년 3분기 안내","permalink":"/whatap-docs/blog/2023-3q-summary"}},"content":"{/* changelog 관련 이미지 */}\\n\\n![새로운 기능 sc](/img/changelog/changelog-new3.png)\\n\\n**새로운 기능**은 와탭 상품별 신규 기능 및 주목할 만한 변경 사항을 분기별로 안내합니다. 서비스 및 에이전트 개요를 요약해 제공합니다. 와탭이 새롭게 제공하는 기능들을 한 눈에 살펴보세요. \\n\\n콘텐츠 상단에서는 테이블 방식으로 해당 분기 신규 기능 및 주요 변경 사항을 간단하게 확인할 수 있습니다. 상품별 서비스 및 에이전트 안내 구성은 다음과 같습니다. \\n\\n{/* truncate */}\\n\\n{/* 콘텐츠 상단에서는 테이블 방식으로 해당 분기 신규 기능 및 주요 변경 사항을 간단하게 확인할 수 있습니다. 상품별 서비스 및 에이전트 안내 구성은 다음과 같습니다.  */}\\n\\n![새로운 기능 콘텐츠 예시 sc cl](/img/changelog/changelog-ex.png)\\n\\n해당 상품의 신규 기능 및 변경 사항을 선별해 소개하고, 해당 분기별 서비스(<code class=\'New\'>New</code>, <code class=\'Feature\'>Feature</code>, <code class=\'Changed\'>Changed</code>) 및 에이전트(<code class=\'New\'>New</code>, <code class=\'Feature\'>Feature</code>, <code class=\'Deprecated\'>Deprecated</code>) 전체적인 흐름을 살펴볼 수 있도록 개요를 해당 건 릴리스 버전과 함께 안내합니다. 릴리스 버전 태그(<code class=\'changelog-service\'><a href=\\"https://docs.whatap.io/release-notes/service/service-2_0_x\\"><code class=\'changelog-service\'>Service 2.0.0​</code></a></code>) 클릭 시 해당 버전의 릴리스 노트로 이동합니다. \\n\\n\\n{/* :::note \\n\\n개요 안내 항목의 릴리스 버전 태그 <code class=\'changelog-service\'><a href=\\"https://docs.whatap.io/release-notes/service/service-2_0_x\\"><code class=\'changelog-service\'>Service 2.0.0​</code></a></code> 클릭 시 해당 버전의 릴리스 노트로 이동합니다.\\n\\n::: */}"}]}}');

